import { Fragment } from "react";
import logo from "./assets/logo.svg";
import Landing from "./Landing";
import Facturas from "./Facturas";

import facebook from "./assets/facebook.svg";
import instagram from "./assets/instagram.svg";
import twitter from "./assets/twitter.svg";

const Header = () => {
  return (
    <Fragment>
      <div className="container">
        {/* ------- HEADER ---------- */}
        <header class="header">
          <img src={logo} alt="Honor logo" class="logo" />;
          <nav class="user-nav">
            <div class="nav-item">ganadores</div>
            <div class="nav-item">facturas</div>
            <div class="nav-item">contacto</div>
            <button class=" nav-btn">participa</button>
          </nav>
        </header>
        <Landing />
        {/* <Facturas /> */}

        {/* ---------- FOOTER ------------- */}
        <div className="footer">
          <div className="social1">
            <img src={logo} alt="Honor logo" class="logo" />;
            <p>email: Honor@customer.com</p>
            <p>tel: 2298- 23-43</p>
          </div>
          <div className="social2">
            <h4>reglamento</h4>
            <p>
              Xerum velectur rem harum, si sit, iditatur a estes et ut
              officipsae vendes magnimp oribus et utem antio dias dolorpor sitae
              nonsendit etur?Imconsedist qui odis eatium dolupta nam
              voluptisquam eturio ea que eseque eatur magni voloreNonsecus
              aligend isimus illaborerum si serspelenem quam eos comnis esse
              consed exeriam volo bernatibus doles dest eatur, seris aut ut e.
            </p>
          </div>
          <div className="social-icons">
            <div>
              <img src={facebook} alt="facebook" class="social-icon" />
            </div>
            <div>
              <img src={twitter} alt="twitter" class="social-icon" />
            </div>
            <div>
              <img src={instagram} alt="instagram" class="social-icon" />
            </div>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default Header;
